import React,{ Component } from 'react';
import './App.css';
import Logged from './components/Model';
import axios from "axios"
import Home from "H"
import {
  BrowserRouter as Router,
  Route,
  Link
} from 'react-router-dom'


export default class App extends Component {
  state={
    id:[],
    title:[],
    url:[],
    train_score:[],
    test_score:[],
  }

  getData=()=>{
    axios.get('main/')
    .then(data=>{
      let newState={...this.state}
      data.data.datum.forEach((item)=>{
        newState.id.push(item._id)
        newState.title.push(item.title)
        newState.train_score.push(item.train_acc)
        newState.test_score.push(item.test_acc)
        newState.url.push('http://placehold.it/300x300')
      })

      this.setState(newState)
    })
  }
  render() {
    return (
      <div>
      <nav className='bg-dark navbar-expand-lg text-right p-1'>
        <a href="#null" className='text-white'>Login</a>
      </nav>

      </div>
    )
  }
}
